import { useNavigate } from 'react-router-dom';

const Header = () => {
    const navigate = useNavigate();

    const handleSearchClick = () => {
        navigate('/search'); 
    };

    return (
        <div id="header">
            <div id="logo">
                <img src="/logo2.png" alt="Logo" />
            </div>
            <div>
                <button id="search" onClick={handleSearchClick}>
                    검색
                </button>
            </div>
            <hr />
        </div>
    );
}

export default Header;
